import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const OpenComplaints = ({ is_admin }) => {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    const getComplaints = async () => {
      try {
        let response;
        if (is_admin) {
          response = await axios.get('http://localhost:5000/complaints/open');
        } else {
          response = await axios.get('http://localhost:5000/complaints');
        }
        setComplaints(response.data.complaints);
      } catch (error) {
        console.error(error);
      }
    };
    getComplaints();
  }, [is_admin]);
  
  return (
    <div>
      <h1>{is_admin ? 'Açık Arızalar' : 'Kullanıcı Arızaları'}</h1>
      <table>
        <thead>
          <tr>
            <th>Arıza No</th>
            <th>Başlık</th>
            <th>Statü</th>
            <th>Detayları Gör</th>
          </tr>
        </thead>
        <tbody>
          {complaints.map((complaint) => (
            <tr key={complaint[0]}>
              <td>{complaint[0]}</td>
              <td>{complaint[2]}</td>
              <td>{complaint[5]}</td>
              <td>
                <Link to={`/complaint/${complaint[0]}`}>Detayları Gör</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OpenComplaints;
